        width: '100%',
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-around',
        backgroundImage: 'linear-gradient(to bottom right, #fff, #D5E5F2)'
    },
    title: {
        textStrokeColor: '#2F4659',
        textFillColor: 'transparent',
        fontWeight: '600',
    },
    tabs: {
        backgroundColor: '#54728C',
    },

    '@media (min-width: 800px)': {
        container: {
            height: '100vh',
            width: '100%',
        },
        title: {
            fontSize: '10vw',
            textStrokeWidth: '3px',
