        tabs: {
            height: '40vh',
            width: '17vw',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'space-around',
            backgroundColor: '#54728C'
        },
        head: {
            fontSize: '1.5em',
            color: '#213440'
